import React from 'react'
import materiel from '../../data/materiel'

function Carousel ()  {
  return (
    <div className="w-64 carousel rounded-box">
        {materiel.map((materiels) => (
        <EventCard key={materiels.id}  description={event.description} photo={event.photo} />
      ))}
    <div className="carousel-item w-full">
      <img src="/assets/img/carousel.png" className="w-full" alt="Tailwind CSS Carousel component" />
    </div> 
  </div>
  )
}

export default Carousel
